import './Header.css'

function Header(){
    return (
        <div>
            <div className="header">

            <Link to="/">Home</Link>

               <span className='mt-3'>Sell & Purchase in Your City.</span>

                {!!localStorage.getItem('token') &&
                 <Link to="/login">   LOGIN   </Link>
                }
            </div>
        </div>

    )
}

export default Header;
